import React from "react";

export function Date() {
  return (
    <form>
      <div className="form-group row">
        <label for="date" className="col-sm-2 col-form-label">
          Purchase Date
        </label>
        <div className="col-sm-10">
          <input
            type="date"
            class="form-control"
            id="date"
            placeholder="dd/mm/yyyy"
          />
        </div>
      </div>
    </form>
  );
}
